import styled from 'styled-components';

export const StyledViewMore = styled.div`
    margin-bottom: 50px;
`; 

export const ViewMoreButton = styled.button`
    font-size: 1em;
    margin: 1em;
    padding: 0.75em 2em;
    background: #1A1C2E;
    color: white;
    border: 2px solid #1A1C2E;
    border-radius: 3px;
`;
